import React, { Component } from 'react'
import { Link } from 'react-router-dom'

export class NavBar extends Component {
  render() {
    return (
      <div>
        <nav>
            <Link to="/">Home</Link>
            <Link to="/websites">Web Sites</Link>
            <Link to="/error">Error</Link>
          </nav>
      </div>
    )
  }
}

export default NavBar
